import jsPDF from './jspdf';
function getFont(){
  return ``;
}
function getBaseBakimFormu(){
  return `data:image/jpeg;base64,`;

}
function getBaseArizaFormu(){
  return `data:image/jpeg;base64,`;

}
function generatePdfBakim(obj:{
  birlikAdi,
  sistemAdi,
  kontrolNo,
  baslangicTarihi,
  baslangicSaati,
  bitisTarihi,
  bitisSaati,
  periyod,
  malzemeler,
  dokuman,
  aciklama,
  personel,
  yonetici,
  personelKase,
  yoneticiKase
}){
  var doc = new jsPDF('l');
  var PTSans = getFont();
  var base64=  getBaseBakimFormu();
  doc.addFileToVFS("PTSans.ttf", PTSans);
  doc.addFont('PTSans.ttf', 'PTSans', 'normal');
  doc.addFont('PTSans.ttf', 'PTSans', 'bold');
  var ttt2:any = JSON.stringify(doc.getFontList());
  ttt2 = ttt2.replace('{','');
  ttt2 = ttt2.replace('}','');
  ttt2 = ttt2.split('],');
  doc.setFont('PTSans');
  doc.addImage(base64,'JPEG',0,0,297,210);
  doc.setFontSize(10);
  doc.setFontType("normal");

  doc.text(obj.birlikAdi, 34, 35);
  doc.text(obj.sistemAdi, 122, 35);
  doc.text(obj.kontrolNo, 232, 35);

  doc.text(obj.baslangicTarihi +" / "+ obj.baslangicSaati, 60, 55);
  doc.text(obj.bitisTarihi +" / "+ obj.bitisSaati, 160, 55);
  doc.text(obj.periyod, 250, 55);

  obj.malzemeler.forEach((malzeme,index) => {
    doc.text(index+1+"", 10, 77 + ( index * 6));
    doc.text(malzeme.name, 21, 77 + ( index * 6));
    doc.text(malzeme.stokNo, 66, 77 + ( index * 6));
    doc.text(malzeme.parcaNo, 96, 77 + ( index * 6));
    doc.text(malzeme.girilenMiktar, 139, 77 + ( index * 6));
    doc.text(malzeme.sarfYeri, 169, 77 + ( index * 6));
    doc.text(malzeme.tedarikYeri, 229, 77 + ( index * 6));
    doc.text(malzeme.fiyati+"", 259, 77 + ( index * 6));
  });


  doc.text(obj.dokuman , 10, 105);
  doc.text(obj.aciklama, 10, 139);

  doc.setFontSize(12);
  doc.text(obj.personel ,38,170)
  doc.setFontSize(8);
  doc.text(obj.personelKase ,38,175)

  doc.setFontSize(12);
  doc.text(obj.yonetici, 220, 170);
  doc.setFontSize(8);
  doc.text(obj.yoneticiKase, 220, 175);

  doc.save(obj.kontrolNo);
}
